import { Link, useParams } from "react-router-dom"

export const EventDetailPage = () => {

  const params = useParams();

  return (
    <>
      <h1>EditEventPage</h1>
      <p>{params.eventId}</p>
      <Link to='..' relative="path" >Back</Link>
    </>
  )
}
